############## generate delta.zip ############
# Requires a git repository, containing at least two versions of the ROM, and tool bsdiff isntalled. Generates diffs 
# between changed files using bsdiff. usage: get_delta *BASE* *COMMIT*,
#    e.g. gen_delta HEAD~1 HEAD
gen_delta() {
    JOBS=10
    echo "Reset to $1..."
    git reset --hard $1
    git clean -fd
    git cherry-pick -n $2
    
    echo "Getting the modified files list..."
    for i in $(git status -uno | grep modified)
    do
        echo $i | cut -d':' -f 2 >> files.txt
    done
    files=$(tr '\n' ' ' < files.txt)
    mkdir -p out
    echo "Copying to ./out..."
    cp --parents $files out
    
    echo "Reset to HEAD..."
    git reset --hard HEAD
    for i in $files
    do
        echo "generating out/$i.bsdiff..."
        
        bsdiff $i out/$i out/$i.bsdiff &

        NPROC=$(($NPROC+1))
        if [ "$NPROC" -ge $JOBS ]; then
            if [ "$VERBOSE" == "1" ]; then
                echo "NPROC == $NPROC, waiting"
            fi
            wait
            NPROC=0
        fi
    done
	
	wait
	
	for i in $files
    do    
        if [ "$DISABLE_MD5_CHECK" != "1" ]; then
            md5sum $i >> orig_md5.txt
            md5sum out/$i >> patched_md5.txt
        fi     
        rm out/$i
    done

    cd out
    cp ../files.txt ../orig_md5.txt ../patched_md5.txt $PWD
    zip -9r ../delta.zip *
    cd ..
    unset DISABLE_MD5_CHECK
}

########## apply delta.zip ##################
# Applies diffs that contains in delta.zip to the ROM. usage: apply_delta *ROM*,
#     e.g. apply_delta vanir_codina_4.4.4.091715.zip
apply_delta() {
    while [ ! $# -eq 0 ]
    do
        case "$1" in
            --disable-md5-check | -d)
                DISABLE_MD5_CHECK=1
                ;;
            *)
                ROM=$1
                ;;
        esac
        shift
    done
    rm -fr out system files.txt orig_md5.txt patched_md5.txt
    unzip delta.zip
    files=$(cat files.txt)
    
    for i in $(find system)
    do
        if test -d $i ; then
            mkdir -p out/$i
        fi
    done
    
    unzip $1 $files
    if [ "$DISABLE_MD5_CHECK" != "1" ]; then
        while read line
        do
            md5=$(echo $line | awk '{print $1}')
            file=$(echo $line | awk '{print $2}')
            if [ "$(md5sum $file | grep -c $md5)" != "1" ] ; then
                echo "check $file md5: mismatch!"
                return
            else
                echo "check $file md5: ok"
            fi
        done < orig_md5.txt

        while read line; 
        do 
            patched_md5[$index]=$line;
            (( index++ ));
        done < patched_md5.txt && unset index
    fi
    
    for i in $files
    do
        echo "patching $i..."
        bspatch $i out/$i $i.bsdiff
        if [ "$DISABLE_MD5_CHECK" != "1" ]; then
            for j in "${patched_md5[@]}"
            do
                line="$(echo $j | grep $i)"
                if [ "$line" != "" ]; then
                    break
                fi
            done
            if [ "$line" != "" ]; then
                md5=$(echo $line | awk '{print $1}')
                file=out/$i
                if [ "$(md5sum $file | grep -c $md5)" != "1" ] ; then
                    echo "check $file md5: mismatch! $md5"
                    return
                else
                    echo "check $file md5: ok"
                fi
            else
                echo "warning: file name not matched: $i"
            fi
        fi
        rm $i.bsdiff
    done
    
    cp out/* $PWD -r
    rm -fr out
    cp $1 $1.bak
    zip -9r $1 $files
    unset DISABLE_MD5_CHECK
    unset ROM
}

########## gen update.zip ##################
# Generates file update.zip with patched ROM files using an existing delta.zip file with diffs.
# Usage: gen_update *ROM*, 
#     e.g. gen_update vanir_codina_4.4.4.091715.zip
gen_update()
{
    JOBS=10
    while [ ! $# -eq 0 ]
    do
        case "$1" in
            --disable-md5-check | -d)
                DISABLE_MD5_CHECK=1
                ;;
            --jobs | -j)
                JOBS=$2
                ;;
            --verbose | -v)
                VERBOSE=1
                ;;
            *)
                ROM=$1
                ;;
        esac
        shift
    done
    rm -fr out system files.txt orig_md5.txt patched_md5.txt update.zip
    unzip delta.zip
    files=$(cat files.txt)
    
    for i in $(find system)
    do
        if test -d $i ; then
            mkdir -p out/$i
        fi
    done
    unzip $ROM $files
    
    if [ "$DISABLE_MD5_CHECK" != "1" ]; then
        while read line
        do
            md5=$(echo $line | awk '{print $1}')
            file=$(echo $line | awk '{print $2}')
            if [ "$(md5sum $file | grep -c $md5)" == "" ] ; then
                echo "check $file md5: mismatch!"
                return
            else
                echo "check $file md5: ok"
            fi
        done < orig_md5.txt

        while read line; 
        do 
            patched_md5[$index]=$line;
            (( index++ ));
        done < patched_md5.txt && unset index
    fi
    
    for i in $files
    do
        echo "patching $i..."
        bspatch $i out/$i $i.bsdiff
        
        if [ "$DISABLE_MD5_CHECK" != "1" ]; then
            for j in "${patched_md5[@]}"
            do
                line="$(echo $j | grep $i)"
                if [ "$line" != "" ]; then
                    break
                fi
            done
            if [ "$line" != "" ]; then
                md5=$(echo $line | awk '{print $1}')
                file=out/$i
                if [ "$(md5sum $file | grep -c $md5)" == "" ] ; then
                    echo "check $file md5: mismatch! $md5"
                    return
                else
                    echo "check $file md5: ok"
                fi
            else
                echo "warning: file name not matched: $i"
            fi
        fi

        NPROC=$(($NPROC+1))
        if [ "$NPROC" -ge $JOBS ]; then
            if [ "$VERBOSE" == "1" ]; then
                echo "NPROC == $NPROC, waiting"
            fi
            wait
            NPROC=0
        fi
    done
    
    wait
    
    for i in $files
    do
        rm $i.bsdiff
    done
    
    cd out
    echo $METAINF | base64 --decode > META-INF.zip
    unzip META-INF.zip
    rm META-INF.zip
    zip -9r ../update.zip META-INF system
    cd ..
    echo "update.zip file is installed to $(realpath ../update.zip)"
    unset DISABLE_MD5_CHECK
    unset ROM
}

METAINF=""
